import React from "react";
import "./signture.css";
import SIGNIN from "./signIn";
import SIGNUP from "./signUp";
const SIGNTURE = () => {
  return <>
  <section className="signtureContainer">
    {/* <div className="welcomeOverlay"></div> */}
    div.
    <SIGNIN/>
    <SIGNUP />
  </section>
  </>;
};
export default SIGNTURE;
